import { BrowserRouter } from "react-router-dom";
import logo from "../logo.svg";

export const Navigation = () => {
  return (
    <BrowserRouter>
      <div className="main-layout">
        <nav>
          <img src={logo} alt="logo de react" />
        </nav>
      </div>
    </BrowserRouter>
  );
};
